import React from 'react';
import vidSrc from '../../assets/enter-sandman.mp4'
import 'react-html5video/dist/styles.css';
import { DefaultPlayer as Video } from 'react-html5video';


const video = (props) => {
    return (<video
        controls
        autoPlay
        src={this.props.src} />)
};

